%[text] This script illustrates how basal gaps are invalidated between data gaps in the raw data.
%   Author: Jan Wrede
%   Date: 2025-10-22
%   
%   This file is part of the larger AIDIF-toolbox project and is licensed 
%       under the MIT license. A copy of the MIT License can be found in 
%       the project's root directory.
%
%   Copyright (c) 2025, AIDIF
%   All rights reserved

%[text] 
%create test basal data with a significant gap
gap = hours(6);
timestamps = datetime("today")+hours([0,1,2,4,8,9,10,12,15,20]) %[output:595b4cb7]
basal_rates = ones(length(timestamps),1)';basal_rates(2:2:end)=0; 
tt = timetable(timestamps', basal_rates', 'VariableNames', {'basal_rate'});

clf; hold on; %[output:340ff078]
[xs, ys] = stairs(tt.Properties.RowTimes, tt.basal_rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate'); %[output:340ff078]
%scatter(tt.Properties.RowTimes, tt.basal_rate,"^","MarkerFaceColor","blue",MarkerEdgeColor="none",DisplayName='Basal Rate Change')
ylim([0, max(tt.basal_rate) + 0.1]) %[output:340ff078]
legend(Location="northwest") %[output:340ff078]
hold off; %[output:340ff078]
%%
%[text] Resample basal data
ttResampled = AIDIF.interpolateBasal(tt);

clf; hold on; %[output:063f8dc7]
[xs, ys] = stairs(tt.Properties.RowTimes, tt.basal_rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate'); %[output:063f8dc7]
%scatter(tt.Properties.RowTimes, tt.basal_rate,"^","MarkerFaceColor","blue",MarkerEdgeColor="none",DisplayName='Basal Rate Change')
ylim([0, max(tt.basal_rate) + 0.1]) %[output:063f8dc7]
legend(Location="northwest") %[output:063f8dc7]
yyaxis('right') %[output:063f8dc7]
stem(ttResampled,"Time","InsulinDelivery",Color='yellow',Marker='.',MarkerSize=10,DisplayName='deliveries') %[output:063f8dc7]
ylabel('U'); %[output:063f8dc7]
hold off %[output:063f8dc7]
%%
%[text] Calculate valid flags for a gap threshold of 2 hours
ttResampled.valid = AIDIF.findGaps(tt.Time,ttResampled.Time,hours(2),false);
% Highlight Nans
valid = ttResampled.valid; % Create a shorthand for the logical array

clf; hold on; %[output:91f6ff05]
[xs, ys] = stairs(tt.Properties.RowTimes, tt.basal_rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate'); %[output:91f6ff05]
%scatter(tt.Properties.RowTimes, tt.basal_rate,"^","MarkerFaceColor","blue",MarkerEdgeColor="none",DisplayName='Basal Rate Change')
ylim([0, max(tt.basal_rate) + 0.1]) %[output:91f6ff05]
legend(Location="northwest") %[output:91f6ff05]
yyaxis('right') %[output:91f6ff05]
stem(ttResampled,"Time","InsulinDelivery",Color='yellow',Marker='.',MarkerSize=10,DisplayName='deliveries') %[output:91f6ff05]
ylabel('U'); %[output:91f6ff05]


scatter(ttResampled.Time(valid ), ttResampled.InsulinDelivery(valid), 5,'o','MarkerEdgeColor','green',DisplayName='valid') %[output:91f6ff05]
scatter(ttResampled.Time(~valid ), ttResampled.InsulinDelivery(~valid), 5,'x','MarkerEdgeColor','red',DisplayName='invalid') %[output:91f6ff05]
ylim([0,5/60+0.1]) %[output:91f6ff05]
xlim([min(tt.Time) - minutes(10), max(tt.Time) + minutes(10)]); %[output:91f6ff05]
hold off %[output:91f6ff05]
%%
%[text] Now, we overlay the valid flags for times that start before and end after the start and end-times just to verify we are setting invalid flags outside the ranges.
%[text] 
timeBeyond = ttResampled.Time(1)-hours(1)+seconds(1):minutes(10):ttResampled.Time(end)+hours(1);
validBeyond = AIDIF.findGaps(tt.Time, timeBeyond, hours(2));

clf; hold on; %[output:57b9266a]
[xs, ys] = stairs(tt.Properties.RowTimes, tt.basal_rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate'); %[output:57b9266a]
%scatter(tt.Properties.RowTimes, tt.basal_rate,"^","MarkerFaceColor","blue",MarkerEdgeColor="none",DisplayName='Basal Rate Change')
ylim([0, max(tt.basal_rate) + 0.1]) %[output:57b9266a]
legend(Location="northwest") %[output:57b9266a]
yyaxis('right') %[output:57b9266a]
stem(ttResampled,"Time","InsulinDelivery",Color='yellow',Marker='.',MarkerSize=10,DisplayName='deliveries') %[output:57b9266a]
ylabel('U'); %[output:57b9266a]

scatter(timeBeyond(validBeyond)', zeros(sum(validBeyond),1), 25,'x','MarkerEdgeColor','green',DisplayName='valid'); %[output:57b9266a]
scatter(timeBeyond(~validBeyond)',zeros(sum(~validBeyond),1), 25,'x','MarkerEdgeColor','red',DisplayName='valid'); %[output:57b9266a]
xlim([timeBeyond(1), timeBeyond(end)]); %[output:57b9266a]
ylim([-0.01,5/60+0.1]) %[output:57b9266a]
hold off %[output:57b9266a]

